import React, { useEffect,useState } from "react";
import { Loader } from "google-maps";
import { key } from "./misc/config";
import "./App.css";
import Location from "./components/Location";
function App() {
  const [map,setMap] =useState('')

  useEffect(() => {

      const loadMap = async () => {
        const load = new Loader(key.google);
        google = await load.load();
        console.log(google);
        setMap(await new google.maps.Map(document.getElementById("map")), {
          center: { lat: 40, lng: -100 },
          scrollwheel: false,
          zoom: 5
        });
      };

    loadMap();
  }, []);
  return (
    <div className="AppRoot">
      <Location map={map}/>
    </div>
  );
}

export default App;
